import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import GlobalProvider from "./contexts/GlobalProvider";
import SquadCommunicator from "./services/SquadCommunicator";

import "./i18n";

//Import Scss
import "./assets/scss/themes.scss";

ReactDOM.render(
  <GlobalProvider>
    <SquadCommunicator>
      <App />
    </SquadCommunicator>
  </GlobalProvider>,
  document.getElementById("root")
);
